import "../Navigation/Navigation.css"

function Navigation() {
    return (
        <div className="main-navigation">
            <div className="main-menu-container">
            <a href="/" className="main-title">Главная</a>
            <a href="/movies" className="main-heading">Фильмы</a>
            <a href="/saved-movies" className="saved-movies-title">Сохранённые фильмы</a>
            </div>
        <button className="account-button">Аккаунт</button>
      </div>
    )
}

export default Navigation;
